import React from "react";

const renderOptions = ({
  countries,
  label,
  input: { onChange, value },
  meta: { touched, error }
}) => (
      <select class="option">
        {countries.map(country => (
          <option value={country}> {country} </option>
        ))}
      </select>
);

export default renderOptions;
